        showMeow(model) {
            if (this.displayModels == 'all') {
                return true;
            }
            if (this.displayModels == 'singles' && Object.values(model).filter(item => item === true).length == 1 ) {
                return true;
            }
            if (this.displayModels == 'doubles' && Object.values(model).filter(item => item === true).length == 2 ) {
                return true;
            }
            if (this.displayModels == 'triples' && Object.values(model).filter(item => item === true).length == 3 ) {
                return true;
            }
            if (this.displayModels == 'quads' && Object.values(model).filter(item => item === true).length == 4 ) {
                return true;
            }
            if (this.displayModels == 'max-cut-schedule' && model.cut_overview ) {
                return true;
            }
            return false;
        },
        showWoof(test) {
            if (this.displayModels == 'all') {
                return true;
            }
            if (this.displayModels == 'singles' && test.models?.length == 1 ) {
                return true;
            }
            if (this.displayModels == 'doubles' && test.models?.length == 2 ) {
                return true;
            }
            if (this.displayModels == 'triples' && test.models?.length == 3 ) {
                return true;
            }
            if (this.displayModels == 'quads' && test.models?.length == 4 ) {
                return true;
            }
            if (this.displayModels == 'max-cut-schedule' && test.max_cut_schedule ) {
                return true;
            }
            return false;

        },
        switchDisplaySize(displayDivider) {
            this.displayDivider = displayDivider;
        },
        switchDisplayModels(displayModels) {
            this.displayModels = displayModels;
        },
        mouseDownHandler(e) {
            const element = e.target;
            element.style.cursor = 'grabbing';
            element.style.userSelect = 'none';
            this.position = {
                // The current scroll
                left: element.scrollLeft,
                top: element.scrollTop,
                // Get the current mouse position
                x: e.clientX,
                y: e.clientY,
            };

            document.addEventListener('mousemove', this.mouseMoveHandler);
            document.addEventListener('mouseup', this.mouseUpHandler);
        },
        mouseMoveHandler(e) {
            const element = e.target;
            const dx = e.clientX - this.position.x;
            const dy = e.clientY - this.position.y;

            // Scroll the element
            element.scrollTop = this.position.top - dy;
            element.scrollLeft = this.position.left - dx;
        },
        mouseUpHandler(e) {
            const element = e.target;
            document.removeEventListener('mousemove', this.mouseMoveHandler);
            document.removeEventListener('mouseup', this.mouseUpHandler);
            element.style.cursor = 'grab';
            element.style.removeProperty('user-select');
        },
    },
